original_question:
En rektangulær mark er omgivet af en atletikbane, som vist nedenfor. Banen består af to kanter af marken og to halvcirkler. Banens længde er 400 meter. Hvad er det størst mulige areal af marken, i kvadratmeter?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

